import React from "react";

import EditTaskForm from "./EditTaskForm";
import {useParams} from "react-router-dom";

export function EditTaskPage(){
    let { taskId } = useParams();
    return(<>
            <h2>Task id={taskId}</h2>
            <EditTaskForm id={taskId}/>
        </>
        )
}
